const styles = StyleSheet.create({
    standardTabBarButton: {
        top: -2,
        flexDirection: "row",
        flex: 1,
        justifyContent: "center",
        alignItems: "center",
        shadowOpacity: 0,
    },
    centralTabBarButton: {
        top: -20,
        justifyContent: "center",
        alignItems: "center",
        flexDirection: "row",
        flex: 1,
    },
    shadow: {
        shadowColor: constants.BLACK,
        shadowOffset: {
            width: 0,
            height: 0
        },
        shadowOpacity: 0.25,
        shadowRadius: 3.5,
        elevation: 3
    }
});
